text:
All systems are looking good for tomorrow’s Falcon 9 launch of the 
@Axiom_Space
 Ax-1 mission to the 
@space_station
; teams are keeping an eye on downrange weather along the ascent corridor. Webcast will go live at ~7:55 a.m. ET → http://spacex.com/launches/ax-1/

NASA has ordered six additional 
@space_station
 resupply missions from SpaceX! Dragon will continue to deliver critical cargo and supplies to and from the orbiting lab through 2026 → http://nasa.gov/feature/nasa-orders-additional-cargo-flights-to-space-station…

Exciting time in commercial spaceflight. Polaris Program will undertake a series of tech demo  missions culminating in first flight of Starship. Thankful to team 
@SpaceX
, Polaris Directors & my amazing crew 
@KiddPoteet
 @gillis_sarahe
, Anna Menon
